type Navlinks = {
  [key: string]: string[];
};

export const navlinks: Navlinks = {
  pt: ["Sobre mim", "Experiência", "Educação", "Habilidades", "Interesses"],
  en: ["About me", "Experience", "Education", "Skills", "Interests"],
};

export const links = [
  "#about",
  "#experience",
  "#education",
  "#skills",
  "#interests",
];
